import {makeAutoObservable} from "mobx"
import axios from 'axios';

export default class Store {
    isAuth = false;
    isLoading = false;
    static isAuth: boolean;
  
    constructor() {
      makeAutoObservable(this);
    }
  
    async setAuth() {
        try {
            this.setAuth(true);
        }
        catch (error) {
            console.log(error);
        }
    }
  }
